  driver_id INT PRIMARY KEY,
  completed_deliveries INT,
  total_miles_driven FLOAT
);

CREATE TABLE delivery_completion (
  delivery_id INT PRIMARY KEY,
  driver_id INT,
  delivery_status VARCHAR(20)
);

CREATE TABLE DriverPerformance (
    driver_id INT PRIMARY KEY,
    total_deliveries INT,
    completed_deliveries INT,
    avg_delivery_time FLOAT
);

CREATE TABLE Drivers (
  driver_id INT PRIMARY KEY,
  driver_name TEXT,
  total_deliveries INT,
  completed_deliveries INT
);

CREATE TABLE Deliveries (
  delivery_id INT PRIMARY KEY,
  driver_id INT,
  delivery_status TEXT,
  delivery_date DATE
);

CREATE TABLE AnalysisResults (
  result_id INT PRIMARY KEY,
  driver_id INT,
  completion_rate FLOAT,
  analysis_date DATE
);

CREATE TABLE driver_performance (
    driver_id INT PRIMARY KEY,
    driver_name VARCHAR(50),
    delivery_completion_rate FLOAT
);

CREATE TABLE delivery_data (
    delivery_id INT PRIMARY KEY,
    driver_id INT,
    delivery_time TIMESTAMP,
    delivery_status VARCHAR(20)
);

CREATE TABLE driver_stats (
    driver_id INT PRIMARY KEY,
    total_deliveries INT,
    total_miles_driven FLOAT,
    average_completion_time TIME
);

CREATE TABLE vehicle_data (
    vehicle_id INT PRIMARY KEY,
    driver_id INT,
    vehicle_type VARCHAR(30),
    vehicle_condition VARCHAR(20)
);

CREATE TABLE delivery_history (
    delivery_id INT PRIMARY KEY,
    driver_id INT,
    delivery_date DATE,
    delivery_time TIME
);
